    const location = useLocation()
    //console.log(location)

    let currentLink:any = []
    const crumbs = location.pathname.split('/')

        .filter(crumb => crumb !== '')
        .map ( (crumb:any ) => {
            currentLink.push(`/${crumb}`)
            return (
                <div key={crumb}>
                    <Link to={currentLink.join('')}>{crumb
                    }</Link>
                </div>
            )

        })
